import SubTitle from "../../../UI/SubTitle/SubTitle";
import InputCheckbox from "../../../UI/InputCheckbox/InputCheckbox";
import SearchOptionTime from "./SearchOptionTime/SearchOptionTime";
import SearchOptionPrice from "./SearchOptionPrice/SearchOptionPrice";
import SearchOptionCategory from "./SearchOptionCategory/SearchOptionCategory";

import style from "./SearchOption.module.css";

function SearchOption() {
  return (
    <div className={style.searchOption}>
      <SubTitle>search by</SubTitle>
      <div>
        <SearchOptionTime />
        <SearchOptionPrice />
        <SearchOptionCategory />
      </div>
      <div>
        <div>category</div>
        <div className={style["checkbox__container"]}>
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="food"
            label="Food"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="transportation"
            label="Transportation"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="clothing"
            label="Clothing"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="entertainment"
            label="Entertainment"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="housing"
            label="Housing"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="others"
            label="Others"
            defaultChecked={true}
          />
        </div>
      </div>
    </div>
  );
}

export default SearchOption;
